async function renter_location(source,destination) {

    // Define origin and destination points
    const origin = source;
    const destination = destination;

    // Define function to calculate distance between two points in miles
    function calculate_distance(coord1, coord2) {
        return geolib.getDistance(
            {latitude: coord1[0], longitude: coord1[1]},
            {latitude: coord2[0], longitude: coord2[1]}
        ) / 1609.344; // Converting meters to miles
    }

    const api_key = '5b3ce3597851110001cf6248ddd53f33b0ef411ab16b3ddf0d255df4';
    const client = new Client({ apiKey: api_key });

    // opensource requires (long,lat) format
    const start_coords = [origin[1],origin[0]];
    const end_coords = [destination[1],destination[0]];

    // Getting the route coordinates
    const response = await client.directions({
        coordinates: [start_coords, end_coords],
        format: 'geojson',
        profile: 'driving-car'
    });
    const geometry = response.routes[0].geometry;
    const decoded = polyline.decode(geometry);

    // Create map centered on origin
    const m = folium.Map(location=origin, zoom_start=14);

    // Adding the route layer
    folium.GeoJson(decoded).add_to(m);

    // Add origin marker to the map
    folium.Marker(location=origin, popup='Origin', icon=folium.Icon(color='blue')).add_to(m);

    // Add destination marker to the map
    folium.Marker(location=destination, popup='Destination', icon=folium.Icon(color='blue')).add_to(m);

    // Display the map
    return m;
}

